let extractedText = [];

for (const item of items) {
  const block = item.json;

  if (!block.type) continue;

  switch (block.type) {

    case "paragraph":
      if (block.content) {
        extractedText.push(block.content);
      }
      break;

    case "bulleted_list_item":
      if (block.content) {
        extractedText.push(`- ${block.content}`);
      }
      break;

    case "numbered_list_item":
      if (block.content) {
        extractedText.push(`1. ${block.content}`);
      }
      break;

    case "child_page":
      if (block.content) {
        extractedText.push(`\n# ${block.content}\n`);
      }
      break;

    case "heading_1":
      if (block.content) {
        extractedText.push(`\n# ${block.content}\n`);
      }
      break;

    case "heading_2":
      if (block.content) {
        extractedText.push(`\n## ${block.content}\n`);
      }
      break;

    case "heading_3":
      if (block.content) {
        extractedText.push(`\n### ${block.content}\n`);
      }
      break;

    case "divider":
      extractedText.push("\n---\n");
      break;

    default:
      // Ignore unsupported block types
      break;
  }
}

return [
  {
    json: {
      text: extractedText.join("\n").trim()
    }
  }
];

const chunkSize = 800;
const overlap = 150;
const text = $json.text;

let chunks = [];
let start = 0;

while (start < text.length) {
  chunks.push(text.slice(start, start + chunkSize));
  start += chunkSize - overlap;
}

return chunks.map((chunk, i) => ({
  json: {
    chunk_text: chunk,
    chunk_id: `kb_${Date.now()}_${i}`
  }
}));

return {
  json: {
    vectors: [
      {
        id: $json.chunk_id,
        values: $json.embedding.values,
        metadata: {
          doc_id: "sales_kb",
          chunk_id: $json.chunk_id,
          source: "notion",
          type: "knowledge_base",
          category: "sales",
          created_at: new Date().toISOString(),
          is_active: true
        }
      }
    ]
  }
};

// Get all items from both nodes
const chunks = $items("Chunking");
const embeddings = $items("Text Embedding");

// Safety check
if (chunks.length !== embeddings.length) {
  throw new Error(
    `Mismatch: ${chunks.length} chunks vs ${embeddings.length} embeddings`
  );
}

// Merge by index
const merged = chunks.map((chunkItem, index) => {
  const embeddingItem = embeddings[index];

  return {
    json: {
      chunk_id: chunkItem.json.chunk_id,
      chunk_text: chunkItem.json.chunk_text,
      embedding: embeddingItem.json.embedding,
    }
  };
});

return merged;

const lead = $json;

const airtable = $node["Limit"].json;

// Helper: include line only if value exists
const line = (label, value) => {
  if (!value || value === "" || value === "Unknown") return null;
  return `${label}: ${value}`;
};

// Helper: join non-empty lines
const section = (lines) => {
  return lines.filter(Boolean).join("\n");
};

// Airtable fields (always expected)
const company = airtable.Company;
const role = airtable.Role;
const message = airtable.Message;

// Enrichment fields (optional)
const industry = airtable.Industry;
const size = lead.size;
const location = lead.location;
const website = lead.website;

// ---- Build sections ----

// Company block
const companySection = section([
  line("Company", company),
  line("Industry", industry),
  line("Company Size", size),
  line("Location", location),
  line("Website", website)
]);

// Contact block
const contactSection = section([
  line("Contact Role", role)
]);

// Message block (always include if exists)
const messageSection = message
  ? `Lead Message:\n${message}`
  : null;

// ---- Combine final context ----

const leadContext = [
  "LEAD CONTEXT",
  "",
  companySection,
  "",
  contactSection,
  "",
  messageSection
]
  .filter(Boolean)
  .join("\n")
  .trim();

return [
  {
    json: {
      lead_context: leadContext,
      raw_message: message || "",
      company: company || null,
      industry: industry || null,
      has_enrichment: Boolean(size || location)
    }
  }
];

// 1. Get raw text from OpenAI "Message a model" node output
const rawText =
  $json.content?.[0]?.text || "";

// 2. Remove ```json ``` code fences and trim
const cleaned = rawText
  .replace(/```json/gi, "")
  .replace(/```/g, "")
  .trim();

// 3. Parse JSON safely
let parsed;
try {
  parsed = JSON.parse(cleaned);
} catch (error) {
  parsed = {
    score: 0,
    tier: "Unqualified",
    reason: "Failed to parse model output"
  };
}

// 4. Normalize values (extra safety)
const score =
  typeof parsed.score === "number" ? parsed.score : 0;

const tier =
  typeof parsed.tier === "string" ? parsed.tier : "Unqualified";

const reason =
  typeof parsed.reason === "string"
    ? parsed.reason
    : "No reason provided";

// 5. Return clean fields for downstream nodes
return [
  {
    json: {
      QualificationScore: score,
      QualificationTier: tier,
      QualificationReason: reason,
      RawModelOutput: rawText
    }
  }
];

const leadContext = $node["Context Format"].json.lead_context;
const matches = $node["Pinecone Query"].json.matches || [];

// Extract knowledge snippets
const knowledge = matches
  .slice(0, 7)
  .map((m, i) => `KNOWLEDGE ${i + 1}:\n${m.metadata.text}`)
  .join("\n\n");

const prompt = `
You are a B2B sales qualification assistant.

Your task:
- Evaluate the lead using the provided knowledge.
- Assign a score from 0â€“100.
- Assign a tier: Unqualified, Nurture, Qualified, High Potential.
- Give a short justification.

Scoring rubric:
- 75â€“100 â†’ High Potential
- 50â€“74 â†’ Qualified
- 25â€“49 â†’ Nurture
- 0â€“24 â†’ Unqualified

===== LEAD =====
${leadContext}

===== KNOWLEDGE =====
${knowledge}

Respond in strict JSON:
{
  "score": number,
  "tier": string,
  "reason": string
}
`.trim();

return [{ json: { prompt } }];

